import React from "react";
import "./NavBar.css";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="main">
      <label>
        <input type="checkbox" />
        <span className="menu">
          {" "}
          <span className="hamburger"></span>{" "}
        </span>
        <ul>
   
          <li>
            {" "}
            <a href="#">Home</a>{" "}
          </li>
          <li>
            {" "}
            <a href="#">Order</a>{" "}
          </li>
          <li>
            {" "}
            <a href="#">Leaderboards</a>{" "}
          </li><li>
            {" "}
            <a href="#">Marketplace</a>{" "}
          </li><li>
            {" "}
            <a href="/faqs">FAQs</a>{" "}
          </li>
        </ul>
      </label>

      
      <Link to="/home">
        <img className="logo" src="./images/Twenteefore - Logo 2.png" />
      </Link>
      <nav className="navbar">
        {" "}
        <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link>
      </nav>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
